import React from "react";
import { Link } from "react-router-dom";

function Nav() {

  function showNavigation()  {
      return (
        <div>

        </div>
      );
  }

  return (
    <header className="flex-row">
      <h1>
        <Link to="/">
          <span role="img" aria-label="Back2Better Logo"></span>
        </Link>
      </h1>

      <nav>
        {showNavigation()}
      </nav>
    </header>
  );
}

export default Nav;
